// Les membres static non constants doivent êtres initialisés dans le .cpp
PacmanView *PacmanView::instance = 0;

/**
 * Constructeur d'un pacman view
 */
PacmanView::PacmanView() : PacmanModel() {
}

/**
 * Renvoi l'unique instance du pacman (Application du pattern singleton)
 * @return Pacman* Pointeur vers l'instance unique de la classe
 */
PacmanView *PacmanView::getInstance() {
	if (PacmanView::instance == 0 )
		instance = new PacmanView();
	return instance;
}

/**
 * Dessine pacman en 2D
 * @return void
 */
void PacmanView::dessine2D() {
	glPushMatrix();
	glTranslated(coord.getX(), coord.getY(), 0);
		glPushMatrix();
			glRotatef(this->direction, 0.0, 0.0, 1.0);
			glColor3f(1, 1, 0); // Définit la couleur de la bouche et des bords
			GLUquadricObj *pacMan;
			pacMan = gluNewQuadric();
			gluQuadricDrawStyle(pacMan, GLU_FILL);
			gluPartialDisk(pacMan, 0.0, 1.0/3, 36, 1, (this->angleBoucheCourant - 10) / 2, 360 - (this->angleBoucheCourant - 10)); 
		glPopMatrix();
		glPushMatrix();
			glRotatef(this->direction, 0.0, 0.0, 1.0);
			glColor3f(this->couleur.getRouge(), this->couleur.getVert(), this->couleur.getBleu());
			gluQuadricDrawStyle(pacMan, GLU_FILL);
			gluPartialDisk(pacMan, 0.0, 1.0/3.2, 36, 1, this->angleBoucheCourant / 2, 360 - this->angleBoucheCourant);
			gluDeleteQuadric(pacMan);
		glPopMatrix();
	glPopMatrix();
}

/**
 * Dessine pacman en 3D
 * @return void
 */
void PacmanView::dessine3D() {
	glPushMatrix();
		glTranslated(coord.getX(), coord.getY(), 0);
		glRotatef(this->direction, 0.0, 0.0, 1.0);
		glCallList(DisplayListPool::getInstance()->getList(PACMAN_3D_LIST + (Utils::round(this->angleBoucheCourant/((float)ANGLE_BOUCHE / NOMBRE_ANIMATION_PACMAN_3D))) % NOMBRE_ANIMATION_PACMAN_3D));
	glPopMatrix();
}

